import React, { Component } from 'react'


export default class Navbar extends Component {
    constructor() {
        super()
        this.state = {
            RisOpen: false,
            LisOpen: false
        }
    }
    RegisterShowModal = () => {
        this.setState({
            RisOpen: true
        });
    };
    LoginShowModal = () => {
        this.setState({
            LisOpen: true
        });
    };
    RegisterOnClose = () => {
        this.setState({ RisOpen: false });
    };
    LoginOnClose = () => {
        this.setState({ LisOpen: false });
    };
    render() {
        return (
            <div className="navbar">
                <div>Image here</div>
                <select className="options" onChange={this.props.changePage}>
                    <option value="merchant">Merchant</option>
                    <option value="user">User</option>
                </select>
                <div className="login break" onClick={this.props.onClickSignUp}>Sign up</div>
                <div className="login" onClick={this.props.onClickLogin}>Login</div>
            </div>
        )
    }
}
